import React from 'react';
import ReactDOM from 'react-dom';


const Hello = (props) => {
  return (
    <div>
      <p>Hello {props.name}, you are {props.age} years old.</p>
    </div>
  )
}




const App = () => {
  const name = "Mike"
  const age = 10
  return (
    <div>
      <h1>Greerings</h1>
      <Hello name="George" age={26 + 10}/>
      <Hello name={name} age={age}/>
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'))
